import './app.css';

import Login from './Login';
import LoggedInNavbar from './LoggedInNavbar';
import TopTracks from './pages/TopTracks';
import TopArtists from './pages/TopArtists';

import { useState, useEffect } from 'react';
import { Route, Routes } from 'react-router-dom';

const code = new URLSearchParams(window.location.search).get("code");

function App() {

  const [userCode, setUserCode] = useState("");

  useEffect(() => {
    if (code) {
      setUserCode(code);
      console.log("User Code In Effect", userCode);
    }
  }, []);

  console.log("User Code Out Effect", userCode);

  return (
    <div>
      {userCode ? <LoggedInNavbar code={userCode} /> : <Login />}
      <Routes>
        <Route path="/" element={<div>Hi</div>} ></Route>
        <Route path="/top-tracks" element={<TopTracks code={code} />} ></Route>
        <Route path="/top-artists" element={<TopArtists code={code} />} ></Route>
      </Routes>
    </div>
  )

}

export default App;
